INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780007202324', 'The Last Battle (Chronicles of Narnia, #7)', '6e2XAJW', 'Paperback', '288', '1956', 'English', 'The Last Battle is a high fantasy novel for children by C. S. Lewis, published by The Bodley Head in 1956. It was the seventh and final novel in The Chronicles of Narnia. Like the other novels in the series, it was illustrated by Pauline Baynes and her work has been retained in many later editions.', 'This edition of Lewis''s classic fantasy fiction is packaged specifically for adults. Complementing the look of the author''s non-fiction books, and anticipating the forthcoming Narnia feature films, this edition contains an exclusive P.S. section about the history of the book, plus a round-up of the first six titles.', '136', TO_DATE('1956-06-21 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781416524304', 'Carrie', '4AGf8Ga', 'Mass Market Paperback', '253', '1974', 'English', 'Carrie is a gothic horror novel by American author Stephen King. It was his first published novel, released on April 5, 1974, with a first print-run of 30,000 copies Several adaptations of Carrie have been released, including a 1976 feature film, a 1988 Broadway musical as well as a 2012 off-Broadway revival, a 1999 feature film sequel, a 2002 television film, and a 2013 feature film,', 'A modern classic, Carrie introduced a distinctive new voice in American fiction -- Stephen King. The story of misunderstood high school girl Carrie White, her extraordinary telekinetic powers, and her violent rampage of revenge, remains one of the most barrier-breaking and shocking novels of all time.', '146', TO_DATE('1974-01-12 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781573225519', 'High Fidelity', '68H4Ice', 'Paperback', '340', '1995', 'English', 'High Fidelity is a novel by British author Nick Hornby first published in 1995. It has sold over a million copies and was later adapted into a feature film in 2000, a Broadway musical in 2006 and a TV series in 2020. In 2003, the novel was listed on the BBC''s survey The Big Read.', 'Do you know your desert-island, all-time, top five most memorable split-ups? Rob does. He keeps a list, in fact. But Laura isn''t on it - even though she''s just become his latest ex. He''s got his life back, you see. He can just do what he wants when he wants: like listen to whatever music he likes, look up the girls that are on his list, and generally behaves as if Laura never mattered. But Rob finds he can''t move on. He''s stuck in a really deep groove - and it''s called Laura. Soon, Rob''s asking himself some big questions: about love, about life - and about why we choose to share ours with the people we do.', '157', TO_DATE('1995-02-05 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781423146728', 'The House of Hades (The Heroes of Olympus, #4)', 'OoZpKRX', 'Hardcover', '597', '2013', 'English', 'The House of Hades is a fantasy-adventure novel written by American author Rick Riordan, based on Greek and Roman mythology. It was published on October 8, 2013, and is the fourth book in The Heroes of Olympus series, preceded by The Mark of Athena and followed by The Blood of Olympus. The novel received positive reviews from critics for its more-mature themes compared to previous Riordan novels. During the first week of its release, The House of Hades sold about 350,000 copies, reaching the top of the bestseller lists of The New York Times, USA Today, The Globe and Mail and The Wall Street Journal.', 'Despite the terrible odds, Hazel, Annabeth, Percy, and the other demigods of the prophecy know that there is only one choice: to attempt the impossible. Not just for themselves, but for everyone they love. Even though love can be the riskiest choice of all.', '139', TO_DATE('2013-06-12 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
