INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780679736370', 'Sophie''s Choice', 'lbW1ZpQ', 'Paperback', '562', '1979', 'English', 'Sophie''s Choice is a 1979 novel by American author William Styron. It concerns the relationships among three people sharing a boarding-house in Brooklyn: Stingo, a young aspiring writer from the South, Jewish scientist Nathan Landau, and his lover Sophie, a Polish-Catholic survivor of the German Nazi concentration camps, whom Nathan befriends.', 'Three stories are told: a young Southerner wants to become a writer; a turbulent love-hate affair between a brilliant Jew and a beautiful Polish woman; and of an awful wound in that woman''s past--one that impels both Sophie and Nathan toward destruction.', '273', TO_DATE('1979-04-23 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781423140603', 'The Mark of Athena (The Heroes of Olympus, #3)', 'CpeYuZ3', 'Hardcover', '586', '2012', 'English', 'The Mark of Athena is an American fantasy-adventure novel written by Rick Riordan, based on Greek and Roman mythology. It was published on October 2, 2012, and is the third book in The Heroes of Olympus series, a sequel of the Percy Jackson & the Olympians series. It is preceded by The Son of Neptune and followed by The House of Hades. The novel is narrated in third-person. The Mark of Athena received positive reviews from critics for its humor, characters, and mix of elements. Criticism was focused on its slow pace, action, and different perspectives. It has since been translated into many languages and released as a hardcover, e-book, audiobook and paperback.', 'Narrated by four different demigods,�The Mark of Athena�is an unforgettable journey across land and sea to Rome, where important discoveries, surprising sacrifices, and unspeakable horrors await. Climb aboard the�Argo II, if you dare. . . .', '275', TO_DATE('2012-08-21 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780307887436', 'Ready Player One (Ready Player One, #1)', 'QQDWY0d', 'Hardcover', '374', '2011', 'English', 'Ready Player One is a 2011 science fiction novel, and the debut novel of American author Ernest Cline. The story, set in a dystopia in 2045, follows protagonist Wade Watts on his search for an Easter egg in a worldwide virtual reality game, the discovery of which would lead him to inherit the game creator''s fortune. Cline sold the rights to publish the novel in June 2010, in a bidding war to the Crown Publishing Group (a division of Random House). The book was published on August 16, 2011. An audiobook was released the same day; it was narrated by Wil Wheaton, who was mentioned briefly in one of the chapters. In 2012, the book received an Alex Award from the Young Adult Library Services Association division of the American Library Association and won the 2011 Prometheus Award.', 'IN THE YEAR 2044, reality is an ugly place. The only time teenage Wade Watts really feels alive is when he''s jacked into the virtual utopia known as the OASIS. Wade''s devoted his life to studying the puzzles hidden within this world''s digital confines, puzzles that are based on their creator''s obsession with the pop culture of decades past and that promise massive power and fortune to whoever can unlock them. But when Wade stumbles upon the first clue, he finds himself beset by players willing to kill to take this ultimate prize. The race is on, and if Wade''s going to survive, he''ll have to win?and confront the real world he''s always been so desperate to escape.', '136', TO_DATE('2011-03-21 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781423140597', 'The Son of Neptune (The Heroes of Olympus, #2)', 'OBaSmy2', 'Hardcover', '521', '2011', 'English', 'The Son of Neptune is a 2011 fantasy-adventure novel written by American author Rick Riordan, based on Greek and Roman mythology. It is the second book in The Heroes of Olympus series, preceded by The Lost Hero and followed by The Mark of Athena. The story follows the adventures of amnesiac Percy Jackson, a demigod son of Neptune also known as Poseidon, as he meets a camp of Roman demigods and goes to Alaska with his new friends Hazel Levesque and Frank Zhang to free the Greek god of death, Thanatos, and help save the world from Gaea, the earth goddess. The novel is narrated in third-person, switching between the points of view of Percy, Frank, and Hazel.', 'Beginning at the "other" camp for half-bloods and extending as far as the land beyond the gods, this breathtaking second installment of the Heroes of Olympus series introduces new demigods, revives fearsome monsters, and features other remarkable creatures, all destined to play a part in the Prophesy of Seven.', '137', TO_DATE('2011-08-05 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780439023511', 'Mockingjay (The Hunger Games, #3)', 'oKUeINA', 'Hardcover', '398', '2010', 'English', 'Mockingjay is a 2010 science fiction novel by American author Suzanne Collins. It is chronologically the last installment of The Hunger Games series, following 2008''s The Hunger Games and 2009''s Catching Fire. The book continues the story of Katniss Everdeen, who agrees to unify the districts of Panem in a rebellion against the tyrannical Capitol.', 'Katniss Everdeen, girl on fire, has survived, even though her home has been destroyed. Gale has escaped. Katniss''s family is safe. Peeta has been captured by the Capitol. District 13 really does exist. There are rebels. There are new leaders. A revolution is unfolding. It is by design that Katniss was rescued from the arena in the cruel and haunting Quarter Quell, and it is by design that she has long been part of the revolution without knowing it. District 13 has come out of the shadows and is plotting to overthrow the Capitol. Everyone, it seems, has had a hand in the carefully laid plans?except Katniss. The success of the rebellion hinges on Katniss''s willingness to be a pawn, to accept responsibility for countless lives, and to change the course of the future of Panem. To do this, she must put aside her feelings of anger and distrust. She must become the rebels'' Mockingjay?no matter what the personal cost.', '139', TO_DATE('2010-03-17 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780517053614', 'The Complete Works', 'IweZdy3', 'Leather Bound', '1248', '1623', 'English', 'The Complete Works is a collection of all the cultural works of one artist, writer, musician, group, etc. For example, Complete Works of Shakespeare is an edition containing all the plays and poems of William Shakespeare. A Complete Works published edition of a text corpus is normally accompanied with additional information and critical apparatus. It may include notes, introduction, a biographical sketch, and may pay attention to textual variants.', 'Containins all the plays and poems of William Shakespeare.', '145', TO_DATE('1623-05-04 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780441627400', 'The Once and Future King (The Once and Future King, #1-4)', 'aO5T8oo', 'Mass Market Paperback', '639', '1958', 'English', 'The Once and Future King is a work by T. H. White loosely based upon the 1485 book Le Morte d''Arthur by Sir Thomas Malory. It was first published in 1958. It collects and revises shorter novels published from 1938 to 1940, with much new material.', 'T.H White?s masterful retelling of the Arthurian legend is an abiding classic. Here all five volumes that make up the story are published in one volume, as White himself always wished. Exquisite comedy offsets the tragedy of Arthur?s personal doom as White brings to life the major British epic of all time with brilliance, grandeur, warmth and charm.', '148', TO_DATE('1958-08-02 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780786226740', 'The Cider House Rules', 'jY7IPJQ', 'Hardcover', '973', '1985', 'English', 'The Cider House Rules (1985) is a novel by American writer John Irving, a Bildungsroman, which was later adapted into a film (1999) and a stage play by Peter Parnell. The story, set in the pre? and post?World War II era, is about a young man, Homer Wells, growing up under the guidance of Dr. Wilbur Larch, an obstetrician and abortionist. The story relates his early life at Larch''s orphanage in Maine and follows Homer as he eventually leaves the nest and comes of age in the world.', 'Raised from birth in the orphanage at St. Cloud''s, Maine, Homer Wells has become the protege of Dr. Wilbur Larch, its physician and director. There Dr. Larch cares for the troubled mothers who seek his help, either by delivering and taking in their unwanted babies or by performing illegal abortions. Meticulously trained by Dr. Larch, Homer assists in the former, but draws the line at the latter. Then a young man brings his beautiful fiancee to Dr. Larch for an abortion, and everything about the couple beckons Homer to the wide world outside the orphanage.', '140', TO_DATE('1985-05-02 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780751514629', 'Different Seasons', 'vaCZeIy', 'Mass Market Paperback', '560', '1982', 'English', 'Different Seasons (1982) is a collection of four Stephen King novellas with a more dramatic bend, rather than the horror fiction for which King is famous. The four novellas are tied together via subtleties that relate to each of the four seasons. The collection is notable for having nearly all of its novellas turned into Hollywood films, one of which, The Shawshank Redemption, was nominated for the 1994 Academy Award for Best Picture.', 'Rita Hayworth and Shawshank Redemption--the most satisfying tale of unjust imprisonment and offbeat escape since The Count of Monte Cristo. Apt Pupil--a golden California schoolboy and an old man whose hideous past he uncovers enter into a fateful and chilling mutual parasitism. The Body--four rambunctious young boys venture into the Maine woods and in sunlight and thunder find life, death, and intimations of their own mortality. The Breathing Method--a tale told in a strange club about a woman determined to give birth no matter what.', '141', TO_DATE('1982-01-13 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780753454947', 'Heidi', 'PgJKflf', 'Paperback', '352', '1880', 'English', 'Heidi is a work of children''s fiction published in 1881 by Swiss author Johanna Spyri, originally published in two parts as Heidi: Her Years of Wandering and Learning and Heidi: How She Used What She Learned. It is a novel about the events in the life of a 5-year-old girl in her paternal grandfather''s care in the Swiss Alps. It was written as a book "for children and those who love children" (as quoted from its subtitle). Heidi is one of the best-selling books ever written and is among the best-known works of Swiss literature.', 'Little orphan Heidi goes to live high in the Alps with her gruff grandfather and brings happiness to all who know her on the mountain. When Heidi goes to Frankfurt to work in a wealthy household, she dreams of returning to the mountains and meadows, her friend Peter, and her beloved grandfather.', '142', TO_DATE('1880-02-03 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780553803716', 'Foundation (Foundation, #1)', 'zYYK2YF', 'Hardcover', '244', '1951', 'English', 'Foundation is a science fiction novel by American writer Isaac Asimov. It is the first published in his Foundation Trilogy (later expanded into the Foundation series). Foundation is a cycle of five interrelated short stories, first published as a single book by Gnome Press in 1951. Collectively they tell the early story of the Foundation, an institute founded by psychohistorian Hari Seldon to preserve the best of galactic civilization after the collapse of the Galactic Empire.', 'For twelve thousand years the Galactic Empire has ruled supreme. Now it is dying. But only Hari Seldon, creator of the revolutionary science of psychohistory, can see into the future -- to a dark age of ignorance, barbarism, and warfare that will last thirty thousand years. To preserve knowledge and save mankind, Seldon gathers the best minds in the Empire -- both scientists and scholars -- and brings them to a bleak planet at the edge of the Galaxy to serve as a beacon of hope for a future generations. He calls his sanctuary the Foundation. But soon the fledgling Foundation finds itself at the mercy of corrupt warlords rising in the wake of the receding Empire. Mankind''s last best hope is faced with an agonizing choice: submit to the barbarians and be overrun -- or fight them and be destroyed.', '153', TO_DATE('1951-07-04 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780152063962', 'Graceling (Graceling Realm, #1)', 'bz3Az22', 'Hardcover', '471', '2008', 'English', 'Graceling is a young adult fantasy novel written by American author Kristin Cashore, her literary debut. The book earned a place on the Publishers Weekly Best Books of the Year for 2008 and received generally favorable reviews. It was followed by a prequel companion book entitled Fire. A sequel companion, Bitterblue, which takes place eight years after the events in Graceling, was published on May 1, 2012, by Dial, an imprint of Penguin Young Readers Group.', 'Katsa has been able to kill a man with her bare hands since she was eight?she?s a Graceling, one of the rare people in her land born with an extreme skill. As niece of the king, she should be able to live a life of privilege, but Graced as she is with killing, she is forced to work as the king?s thug. She never expects to fall in love with beautiful Prince Po. She never expects to learn the truth behind her Grace?or the terrible secret that lies hidden far away . . . a secret that could destroy all seven kingdoms with words alone. With elegant, evocative prose and a cast of unforgettable characters, debut author Kristin Cashore creates a mesmerizing world, a death-defying adventure, and a heart-racing romance that will consume you, hold you captive, and leave you wanting more.', '143', TO_DATE('2008-02-02 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780743298025', 'The Thirteenth Tale', 'DawbCqy', 'Hardcover', '406', '2006', 'English', 'The Thirteenth Tale is a book which shifts between two main stories. One tells of the life of amateur biographer Margaret Lea and her exploration of the Angelfield/March family''s past. ... The Thirteenth Tale is told through a first-person point of view, commonly Margaret Lea''s.', 'All children mythologize their birth...So begins the prologue of reclusive author Vida Winter''s collection of stories, which are as famous for the mystery of the missing thirteenth tale as they are for the delight and enchantment of the twelve that do exist. The enigmatic Winter has spent six decades creating various outlandish life histories for herself -- all of them inventions that have brought her fame and fortune but have kept her violent and tragic past a secret. Now old and ailing, she at last wants to tell the truth about her extraordinary life. She summons biographer Margaret Lea, a young woman for whom the secret of her own birth, hidden by those who loved her most, remains an ever-present pain. Struck by a curious parallel between Miss Winter''s story and her own, Margaret takes on the commission. As Vida disinters the life she meant to bury for good, Margaret is mesmerized. It is a tale of gothic strangeness featuring the Angelfield family, including the beautiful and willful Isabelle, the feral twins Adeline and Emmeline, a ghost, a governess, a topiary garden and a devastating fire. Margaret succumbs to the power of Vida''s storytelling but remains suspicious of the author''s sincerity. She demands the truth from Vida, and together they confront the ghosts that have haunted them while becoming, finally, transformed by the truth themselves. The Thirteenth Tale is a love letter to reading, a book for the feral reader in all of us, a return to that rich vein of storytelling that our parents loved and that we loved as children. Diane Setterfield will keep you guessing, make you wonder, move you to tears and laughter and, in the end, deposit you breathless yet satisfied back upon the shore of your everyday life.', '144', TO_DATE('2006-08-12 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780375814242', 'James and the Giant Peach', 'FpiRX6L', 'Hardcover', '146', '1961', 'English', 'James and the Giant Peach is a popular children''s novel written in 1961 by British author Roald Dahl. The first edition, published by Alfred Knopf, featured illustrations by Nancy Ekholm Burkert. There have been reillustrated versions of it over the years, done by Michael Simeon (for the first British edition), Emma Chichester Clark, Lane Smith and Quentin Blake. It was adapted into a film of the same name in 1996, and a musical in 2010.', 'The plot centres on a young English orphan boy who enters a gigantic, magical peach, and has a wild and surreal cross-world adventure with seven magically-altered garden bugs he meets. Roald Dahl was originally going to write about a giant cherry, but changed it to James and the Giant Peach because a peach is "prettier, bigger and squishier than a cherry." Because of the story''s occasional macabre and potentially frightening content, it has become a regular target of censors. Dahl dedicated the book to his six-year-old daughter, Olivia, who died only a year after the book was published.', '146', TO_DATE('1961-03-12 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780060557812', 'Neverwhere (London Below, #1)', 'jsiTuei', 'Paperback', '370', '1996', 'English', 'Neverwhere is the companion novelisation written by English author Neil Gaiman of the television serial Neverwhere, written by Gaiman and devised by Lenny Henry. The plot and characters are exactly the same as in the series, with the exception that the novel form allowed Gaiman to expand and elaborate on certain elements of the story and restore changes made in the televised version from his original plans. Most notable is the appearance of the Floating Market at Harrods (in the novel) rather than under Battersea power station (the TV series). This is because the management of Harrods changed their minds about proposed filming. The novel was originally released by BBC Books in 1996, three episodes into the television series run. It was accompanied by a spoken word CD and cassette release, also by the BBC. The novel enjoyed great success, whereas its television roots did not receive as much international exposure as the novel. In addition to being translated into various languages, it was also re-published as an "Author''s Preferred Text" version, (a combination of the international and original English version, with additional scenes re-inserted by Gaiman) alongside American Gods in 2006. The original BBC Books version had a cover by longtime Gaiman collaborator Dave McKean, taken from the bird''s head rings, flaming fist and London Underground styled graphics created by McKean for the series, as well as a brief section by Gaiman on the making of the series.', 'Under the streets of London there''s a place most people could never even dream of. A city of monsters and saints, murderers and angels, knights in armour and pale girls in black velvet. This is the city of the people who have fallen between the cracks. Richard Mayhew, a young businessman, is going to find out more than enough about this other London. A single act of kindness catapults him out of his workday existence and into a world that is at once eerily familiar and utterly bizarre. And a strange destiny awaits him down here, beneath his native city: Neverwhere.', '147', TO_DATE('1996-03-18 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780345476883', 'The Vampire Lestat (The Vampire Chronicles, #2)', 'aHez2ZY', 'Paperback', '481', '1985', 'English', 'The Vampire Lestat (1985) is a vampire novel by American writer Anne Rice, the second in her Vampire Chronicles, following Interview with the Vampire (1976). The story is told from the point of view of the vampire Lestat de Lioncourt as narrator, while Interview is narrated by Louis de Pointe du Lac. Several events in the two books appear to contradict each other, allowing the reader to decide which version of events they believe to be accurate.', 'Lestat. The vampire hero of Anne Rice''s enthralling new novel is a creature of the darkest and richest imagination. Once an aristocrat in the heady days of pre-revolutionary France, now a rock star in the demonic, shimmering 1980s, he rushes through the centuries in search of others like him, seeking answers to the mystery of his eternal, terrifying existence. His is a mesmerizing story --- passionate, complex, and thrilling.', '149', TO_DATE('1985-08-11 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780439709101', 'Inkheart (Inkworld, #1)', 'sWoFCWw', 'Paperback', '563', '2003', 'English', 'Inkheart (German: Tintenherz) is a 2003 young adult fantasy novel by Cornelia Funke, and the first book of the Inkheart trilogy, which was continued with Inkspell (2005) and Inkdeath (2007). The novel won the 2004 BookSense Book of the Year Award for Children''s Literature. Based on a 2007 online poll, the National Education Association listed the book as one of its "Teachers'' Top 100 Books for Children". Inkheart was the first part of a trilogy and was continued with Inkspell (2005), which won Funke her second BookSense Book of the Year Award for Children''s Literature in 2006. The trilogy was initially concluded in Inkdeath, but has been revived in 2020 when Funke announced that a sequel called The Colour of Revenge (German: Die Farbe der Rache) was published by October 2021 in Germany. Following the release of the first Inkheart novel, New Line Cinema bought the film rights to all three books for a cinema adaptation. Directed by Iain Softley, the film is based on a screenplay by David Lindsay-Abaire and features an ensemble cast that includes Brendan Fraser, Helen Mirren, Paul Bettany, Jim Broadbent, Rafi Gavron, Andy Serkis and newcomer Eliza Bennett, among others. Upon release, the film received mixed reviews. In 2009, a video game based on the film was released for the Nintendo DS.', 'From internationally acclaimed storyteller Cornelia Funke, this bestselling, magical epic is now out in paperback! One cruel night, Meggie''s father reads aloud from a book called INKHEART-- and an evil ruler escapes the boundaries of fiction and lands in their living room. Suddenly, Meggie is smack in the middle of the kind of adventure she has only read about in books. Meggie must learn to harness the magic that has conjured this nightmare. For only she can change the course of the story that has changed her life forever. This is INKHEART--a timeless tale about books, about imagination, about life. Dare to read it aloud.', '150', TO_DATE('2003-02-11 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780142414934', 'Paper Towns', 'gHAFJbK', 'Paperback', '305', '2008', 'English', 'Paper Towns is a novel written by John Green, primarily for an audience of young adults, and was published on October 16, 2008, by Dutton Books. The novel is about the coming-of-age of the protagonist, Quentin "Q" Jacobsen and his search for Margo Roth Spiegelman, his neighbor and childhood sweetheart.', 'Quentin Jacobsen has spent a lifetime loving the magnificently adventurous Margo Roth Spiegelman from afar. So when she cracks open a window and climbs into his life?dressed like a ninja and summoning him for an ingenious campaign of revenge?he follows. After their all-nighter ends, and a new day breaks, Q arrives at school to discover that Margo, always an enigma, has now become a mystery. But Q soon learns that there are clues?and they''re for him. Urged down a disconnected path, the closer he gets, the less Q sees the girl he thought he knew...', '154', TO_DATE('2008-03-19 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780440174646', 'Roots: The Saga of an American Family', 'zmm1gEX', 'Mass Market Paperback', '888', '1976', 'English', 'Roots: The Saga of an American Family is a 1976 novel written by Alex Haley. It tells the story of Kunta Kinte, an 18th-century African, captured as an adolescent, sold into slavery in Africa, transported to North America; following his life and the lives of his descendants in the United States down to Haley. The release of the novel, combined with its hugely popular television adaptation, Roots (1977), led to a cultural sensation in the United States. The novel spent forty-six weeks on The New York Times Best Seller List, including twenty-two weeks at number one. The last seven chapters of the novel were later adapted in the form of a second miniseries, Roots: The Next Generations (1979). It stimulated interest in African American genealogy and an appreciation for African-American history. The book was originally described as "fiction," yet sold in the non-fiction section of bookstores. Haley spent the last chapter of the book describing his research in archives and libraries to support his family''s oral tradition with written records.', 'Haley has talked in Juffure with his own African sixth cousins. On September 29, 1967, he stood on the dock in Annapolis where his great-great-great-great-grandfather was taken ashore on September 29, 1767. Now he has written the monumental two-century drama of Kunta Kinte and the six generations who came after him?slaves and freedmen, farmers and blacksmiths, lumber mill workers and Pullman porters, lawyers and architects?and one author. But Haley has done more than recapture the history of his own family. As the first black American writer to trace his origins back to their roots, he has told the story of 25,000,000 Americans of African descent. He has rediscovered for an entire people a rich cultural heritage that slavery took away from them, along with their names and their identities. But Roots speaks, finally, not just to blacks, or to whites, but to all people and all races everywhere, for the story it tells is one of the most eloquent testimonials ever written to the indomitability of the human spirit.', '155', TO_DATE('1976-04-22 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780553383805', 'The House of the Spirits', 'HD1Di5V', 'Paperback', '448', '1982', 'English', 'The House of the Spirits is the debut novel of Isabel Allende. The novel was rejected by several Spanish-language publishers before being published in Buenos Aires in 1982. It became an instant best-seller, was critically acclaimed, and catapulted Allende to literary stardom. The novel was named Best Novel of the Year in Chile in 1982, and Allende received the country''s Panorama Literario award. The House of the Spirits has been translated into over 20 languages. The book was first conceived by Allende when she received news that her 100-year-old grandfather was dying. She began to write him a letter that ultimately became the manuscript of The House of the Spirits. ', 'In one of the most important and beloved Latin American works of the twentieth century, Isabel Allende weaves a luminous tapestry of three generations of the Trueba family, revealing both triumphs and tragedies. Here is patriarch Esteban, whose wild desires and political machinations are tempered only by his love for his ethereal wife, Clara, a woman touched by an otherworldly hand. Their daughter, Blanca, whose forbidden love for a man Esteban has deemed unworthy infuriates her father, yet will produce his greatest joy: his granddaughter Alba, a beautiful, ambitious girl who will lead the family and their country into a revolutionary future.', '156', TO_DATE('1982-06-14 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780553582024', 'A Feast for Crows (A Song of Ice and Fire, #4)', 'bRkPdny', 'Mass Market Paperback', '1061', '2005', 'English', 'A Feast for Crows is the fourth of seven planned novels in the epic fantasy series A Song of Ice and Fire by American author George R. R. Martin. The novel was first published on October 17, 2005, in the United Kingdom, with a United States edition following on November 8, 2005. A Feast for Crows was the first novel in the series to debut at number one on The New York Times Best Seller list, a feat among fantasy writers only previously achieved by Robert Jordan and Neil Gaiman. In 2006 the novel was nominated for the Hugo Award, the Locus Award, and the British Fantasy Society Award. It has since been adapted, along with A Dance With Dragons, for television as the fifth season of Game of Thrones, though elements of the novel appeared in the series'' fourth and sixth seasons.', 'Bloodthirsty, treacherous and cunning, the Lannisters are in power on the Iron Throne in the name of the boy-king Tommen. The war in the Seven Kingdoms has burned itself out, but in its bitter aftermath new conflicts spark to life. The Martells of Dorne and the Starks of Winterfell seek vengeance for their dead. Euron Crow''s Eye, as black a pirate as ever raised a sail, returns from the smoking ruins of Valyria to claim the Iron Isles. From the icy north, where Others threaten the Wall, apprentice Maester Samwell Tarly brings a mysterious babe in arms to the Citadel. Against a backdrop of incest and fratricide, alchemy and murder, victory will go to the men and women possessed of the coldest steel and the coldest hearts.', '276', TO_DATE('2005-01-03 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781442408920', 'Aristotle and Dante Discover the Secrets of the Universe (Aristotle and Dante, #1)', 'SfMfwA8', 'Hardcover', '359', '2012', 'English', 'Aristotle and Dante Discover the Secrets of the Universe is a coming-of-age young adult novel by American author Benjamin Alire Saenz which was first published February 21, 2012. Set in El Paso, Texas in 1987, the novel follows two Mexican-American teenagers, Aristotle "Ari" Mendoza and Dante Quintana, their friendship, and their struggles with racial and ethnic identity, sexuality, and family relationships. Since its publication, the novel has received widespread critical acclaim and numerous accolades. A sequel titled Aristotle and Dante Dive into the Waters of the World was released on October 12, 2021.', 'Dante can swim. Ari can''t. Dante is articulate and self-assured. Ari has a hard time with words and suffers from self-doubt. Dante gets lost in poetry and art. Ari gets lost in thoughts of his older brother who is in prison. Dante is fair skinned. Ari''s features are much darker. It seems that a boy like Dante, with his open and unique perspective on life, would be the last person to break down the walls that Ari has built around himself. But against all odds, when Ari and Dante meet, they develop a special bond that will teach them the most important truths of their lives, and help define the people they want to be. But there are big hurdles in their way, and only by believing in each other?and the power of their friendship?can Ari and Dante emerge stronger on the other side.', '135', TO_DATE('2012-01-09 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780316921176', 'Infinite Jest', 'idF35HZ', 'Paperback', '1088', '1996', 'English', 'Set in an addicts'' halfway house and a tennis academy, and featuring the most endearingly screwed-up family to come along in recent fiction, Infinite Jest explores essential questions about what entertainment is and why it has come to so dominate our lives; about how our desire for entertainment affects our need to connect with other people; and about what the pleasures we choose say about who we are. Equal parts philosophical quest and screwball comedy, Infinite Jest bends every rule of fiction without sacrificing for a moment its own entertainment value. It is an exuberant, uniquely American exploration of the passions that make us human?and one of those rare books that renew the idea of what a novel can do.', 'Infinite Jest is a novel by American writer David Foster Wallace. The novel has an unconventional narrative structure and includes hundreds of extensive endnotes, some with footnotes of their own. Categorized as an encyclopedic novel, Infinite Jest is featured in TIME magazine''s list of the 100 best English-language novels published between 1923 and 2005. A literary fiction bestseller after having sold 44,000 hardcover copies in its first year of publication, the novel has since sold more than a million copies worldwide.', '137', TO_DATE('1996-02-08 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780822210894', 'A Streetcar Named Desire', '7XJJdU2', 'Paperback', '107', '1947', 'English', 'A Streetcar Named Desire is a play written by Tennessee Williams and first performed on Broadway on December 3, 1947. The play dramatizes the experiences of Blanche DuBois, a former Southern belle who, after encountering a series of personal losses, leaves her privileged background to move into a shabby apartment in New Orleans rented by her younger sister and brother-in-law.', 'It is a very short list of 20th-century American plays that continue to have the same power and impact as when they first appeared?57 years after its Broadway premiere, Tennessee Williams? A Streetcar Named Desire is one of those plays. The story famously recounts how the faded and promiscuous Blanche DuBois is pushed over the edge by her sexy and brutal brother-in-law, Stanley Kowalski. Streetcar launched the careers of Marlon Brando, Jessica Tandy, Kim Hunter, and Karl Malden, and solidified the position of Tennessee Williams as one of the most important young playwrights of his generation, as well as that of Elia Kazan as the greatest American stage director of the ?40s and ?50s.', '140', TO_DATE('1947-01-06 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781400030651', 'A Fine Balance', 'OqhbBrJ', 'Paperback', '603', '1995', 'English', 'A Fine Balance is the second novel by Rohinton Mistry, published in 1995. Set in "an unidentified city" in India, initially in 1975 and later in 1984 during the turmoil of The Emergency, the book concerns four characters from varied backgrounds ? Dina Dalal, Ishvar Darji, his nephew Omprakash Darji and the young student Maneck Kohlah ? who come together and develop a bond. First published in 1995, it won the 1995 Giller Prize. It was shortlisted for the Booker Prize in 1996. It was one of the only two Canadian books selected for Oprah''s Book Club, and was one of the selected books in the 2002 edition of Canada Reads, championed by actress Megan Follows. In 2014, A Fine Balance was ranked in The Telegraph as one of the 10 all-time greatest Asian novels. Emma-Lee Potter of The Independent listed it as the book with the strongest prose and character development out of 12 Indian novels "that everyone needs to read."', 'A Fine BalanceWith a compassionate realism and narrative sweep that recall the work of Charles Dickens, this magnificent novel captures all the cruelty and corruption, dignity and heroism, of India. The time is 1975. The place is an unnamed city by the sea. The government has just declared a State of Emergency, in whose upheavals four strangers--a spirited widow, a young student uprooted from his idyllic hill station, and two tailors who have fled the caste violence of their native village--will be thrust together, forced to share one cramped apartment and an uncertain future. As the characters move from distrust to friendship and from friendship to love, A Fine Balance creates an enduring panorama of the human spirit in an inhuman state.', '142', TO_DATE('1995-01-04 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780451528957', 'Dr. Jekyll and Mr. Hyde', '5RgGN4l', 'Paperback', '139', '1886', 'English', 'Strange Case of Dr Jekyll and Mr Hyde is a Gothic novella by Scottish author Robert Louis Stevenson, first published in 1886. The work is also known as The Strange Case of Jekyll Hyde, Dr. Jekyll and Mr. Hyde, or simply Jekyll and Hyde. It is about a London legal practitioner named Gabriel John Utterson who investigates strange occurrences between his old friend, Dr. Henry Jekyll, and the evil Edward Hyde. The novella''s impact is such that it has become a part of the language, with the vernacular phrase "Jekyll and Hyde" referring to people with an unpredictably dual nature: outwardly good, but sometimes shockingly evil.', 'Robert Louis Stevenson''s masterpiece of the duality of good and evil in man''s nature sprang from the darkest recesses of his own unconscious?during a nightmare from which his wife awakened him, alerted by his screams. More than a hundred years later, this tale of the mild-mannered Dr. Jekyll and the drug that unleashes his evil, inner persona?the loathsome, twisted Mr. Hyde?has lost none of its ability to shock. Its realistic police-style narrative chillingly relates Jekyll''s desperation as Hyde gains control of his soul?and gives voice to our own fears of the violence and evil within us. Written before Freud''s naming of the ego and the id, Stevenson''s enduring classic demonstrates a remarkable understanding of the personality''s inner conflicts?and remains the irresistibly terrifying stuff of our worst nightmares.', '144', TO_DATE('1886-03-01 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781451627282', '11/22/63', 'hZeLXfg', 'Hardcover', '849', '2011', 'English', '11/22/63 is a novel by Stephen King about a time traveller who attempts to prevent the assassination of United States President John F. Kennedy, which occurred on November 22, 1963 (the novel''s titular date). It is the 60th book published by Stephen King, his 49th novel and the 42nd under his own name. The novel was announced on King''s official site on March 2, 2011. A short excerpt was released online on June 1, 2011, and another excerpt was published in the October 28, 2011, issue of Entertainment Weekly. The novel was published on November 8, 2011 and quickly became a number-one bestseller. It stayed on The New York Times Best Seller list for 16 weeks. 11/22/63 won the 2011 Los Angeles Times Book Prize for Best Mystery/Thriller and the 2012 International Thriller Writers Award for Best Novel, and was nominated for the 2012 British Fantasy Award for Best Noveland the 2012 Locus Award for Best Science Fiction Novel.', 'Jake Epping is a thirty-five-year-old high school English teacher in Lisbon Falls, Maine, who makes extra money teaching adults in the GED program. He receives an essay from one of the students?a gruesome, harrowing first person story about the night 50 years ago when Harry Dunning?s father came home and killed his mother, his sister, and his brother with a hammer. Harry escaped with a smashed leg, as evidenced by his crooked walk. Not much later, Jake?s friend Al, who runs the local diner, divulges a secret: his storeroom is a portal to 1958. He enlists Jake on an insane?and insanely possible?mission to try to prevent the Kennedy assassination. So begins Jake?s new life as George Amberson and his new world of Elvis and JFK, of big American cars and sock hops, of a troubled loner named Lee Harvey Oswald and a beautiful high school librarian named Sadie Dunhill, who becomes the love of Jake?s life?a life that transgresses all the normal rules of time.', '145', TO_DATE('2011-01-01 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780450417399', 'Misery', '3oTVCw8', 'Paperback', '370', '1987', 'English', 'Misery is an American psychological horror thriller novel written by Stephen King. The novel''s narrative is based on the relationship of its two main characters ? the romance novelist Paul Sheldon and his deranged fan Annie Wilkes. When Paul is seriously injured following a car accident, former nurse Annie brings him to her home, where Paul receives treatment and doses of pain medication. Paul realizes that he is a prisoner and is forced to indulge his captor''s whims. The novel''s title has two meanings: it is the name carried by the central heroine of Paul''s book series, and King described such a state of emotion during the novel''s writing. King has outlined the creation of Misery in his memoirs, and mentioned that the image of Annie Wilkes came to him in a dream. King planned the book to be released under the pseudonym Richard Bachman, but his identity was discovered before the book''s release. Misery won the first Bram Stoker Award for Novel in 1987 and was nominated for the 1988 World Fantasy Award for Best Novel. Critical reception of Misery was positive. Reviewers praised King for avoiding the fantasy elements of his past works, and noted the novel''s parallels with King''s personal life and the study of the relationship between celebrities and their fans. The novel, which took fourth place in the 1987 bestseller list, was adapted into a film directed by Rob Reiner in 1990, and into a theatrical production starring Laurie Metcalf and Bruce Willis in 2015.', 'Paul Sheldon. He''s a bestselling novelist who has finally met his biggest fan. Her name is Annie Wilkes and she is more than a rabid reader - she is Paul''s nurse, tending his shattered body after an automobile accident. But she is also his captor, keeping him prisoner in her isolated house.', '157', TO_DATE('1987-03-15 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780553381696', 'A Clash of Kings  (A Song of Ice and Fire, #2)', 'Z5UoDW0', 'Paperback', '969', '1998', 'English', 'A Clash of Kings is the second novel in A Song of Ice and Fire, an epic fantasy series by American author George R. R. Martin expected to consist of seven volumes. It was first published on November 16, 1998 in the United Kingdom; the first United States edition followed on February 2, 1999. Like its predecessor, A Game of Thrones, it won the Locus Award (in 1999) for Best Novel and was nominated for the Nebula Award (also in 1999) for best novel. In May 2005, Meisha Merlin released a limited edition of the novel, fully illustrated by John Howe. The novel has been adapted for television by HBO as the second season of the TV series Game of Thrones. A Clash of Kings is also the name of the first expansion to the Game of Thrones board game.', 'A comet the color of blood and flame cuts across the sky. Two great leaders?Lord Eddard Stark and Robert Baratheon?who hold sway over an age of enforced peace are dead, victims of royal treachery. Now, from the ancient citadel of Dragonstone to the forbidding shores of Winterfell, chaos reigns. Six factions struggle for control of a divided land and the Iron Throne of the Seven Kingdoms, preparing to stake their claims through tempest, turmoil, and war. It is a tale in which brother plots against brother and the dead rise to walk in the night. Here a princess masquerades as an orphan boy; a knight of the mind prepares a poison for a treacherous sorceress; and wild men descend from the Mountains of the Moon to ravage the countryside. Against a backdrop of incest and fratricide, alchemy and murder, victory may go to the men and women possessed of the coldest steel...and the coldest hearts. For when kings clash, the whole land trembles. Here is the second volume in George R.R. Martin magnificent cycle of novels that includes A Game of Thrones and A Storm of Swords. As a whole, this series comprises a genuine masterpiece of modern fantasy, bringing together the best the genre has to offer. Magic, mystery, intrigue, romance, and adventure fill these pages and transport us to a world unlike any we have ever experienced. Already hailed as a classic, George R.R. Martin stunning series is destined to stand as one of the great achievements of imaginative fiction.', '160', TO_DATE('1998-01-02 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780671021009', 'She''s Come Undone', 'aNvutBb', 'Mass Market Paperback', '465', '1992', 'English', 'She''s Come Undone is the 1992 debut novel by Wally Lamb. The novel was selected as the fourth book for Oprah''s Book Club in December 1996. Lamb''s novel was named a finalist for the 1992 Los Angeles Book Awards'' Art Seidenbaum Prize for first fiction. She''s Come Undone has been translated into eighteen languages.', 'In this extraordinary coming-of-age odyssey, Wally Lamb invites us to hitch a wild ride on a journey of love, pain, and renewal with the most heartbreakingly comical heroine to come along in years. Meet Dolores Price. She''s 13, wise-mouthed but wounded, having bid her childhood goodbye. Stranded in front of her bedroom TV, she spends the next few years nourishing herself with the Mallomars, potato chips, and Pepsi her anxious mother supplies. When she finally orbits into young womanhood at 257 pounds, Dolores is no stronger and life is no kinder. But this time she''s determined to rise to the occasion and give herself one more chance before she really goes under.', '271', TO_DATE('1992-04-22 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780451933027', 'The Green Mile', 'Wks9lkp', 'Paperback', '592', '1996', 'English', 'The Green Mile is a 1996 serial novel by American writer Stephen King. It tells the story of death row supervisor Paul Edgecombe''s encounter with John Coffey, an unusual inmate who displays inexplicable healing and empathetic abilities. The serial novel was originally released in six volumes before being republished as a single-volume work. The book is an example of magical realism.', 'Welcome to Cold Mountain Penitentiary, home to the Depression-worn men of E Block. Convicted killers all, each awaits his turn to walk the Green Mile, keeping a date with "Old Sparky," Cold Mountain''s electric chair. Prison guard Paul Edgecombe has seen his share of oddities in his years working the Mile. But he''s never seen anyone like John Coffey, a man with the body of a giant and the mind of a child, condemned for a crime terrifying in its violence and shocking in its depravity. In this place of ultimate retribution, Edgecombe is about to discover the terrible, wondrous truth about Coffey, a truth that will challenge his most cherished beliefes... and yours.', '272', TO_DATE('1996-06-12 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('1250301696', 'The Silent Patient', 'vpdUBwg', 'Paperback', '325', '2019', 'English', 'The Silent Patient is a 2019 psychological thriller novel written by British–Cypriot author Alex Michaelides. The debut novel was published by Celadon Books, a division of Macmillan Publishers, on 5 February 2019. The audiobook version, released on the same date, is read by Louise Brealey and Jack Hawkins.', 'Alicia Berenson’s life is seemingly perfect. A famous painter married to an in-demand fashion photographer, she lives in a grand house with big windows overlooking a park in one of London’s most desirable areas. One evening her husband Gabriel returns home late from a fashion shoot, and Alicia shoots him five times in the face, and then never speaks another word.
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780316067928', 'Breaking Dawn (The Twilight Saga, #4)', 'SBMz6Gs', 'Hardcover', '756', '2008', 'English', 'Breaking Dawn is the 2008 fourth novel in The Twilight Saga by American author Stephenie Meyer. Divided into three parts, the first and third sections are written from Bella Swan''s perspective and the second is written from the perspective of Jacob Black.', 'To be irrevocably in love with a vampire is both fantasy and nightmare woven into a dangerously heightened reality for Bella Swan. Pulled in one direction by her intense passion for Edward Cullen, and in another by her profound connection to werewolf Jacob Black, a tumultuous year of temptation, loss, and strife have led her to the ultimate turning point. Her imminent choice to either join the dark but seductive world of immortals or to pursue a fully human life has become the thread from which the fates of two tribes hangs.
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780439655484', 'Harry Potter and the Prisoner of Azkaban (Harry Potter, #3)', 'gac31I2', 'Mass Market Paperback', '435', '1999', 'English', 'Harry Potter and the Prisoner of Azkaban is a fantasy novel written by British author J. K. Rowling and is the third in the Harry Potter series. The book follows Harry Potter, a young wizard, in his third year at Hogwarts School of Witchcraft and Wizardry.', 'For twelve long years, the dread fortress of Azkaban held an infamous prisoner named Sirius Black. Convicted of killing thirteen people with a single curse, he was said to be the heir apparent to the Dark Lord, Voldemort.Now he has escaped, leaving only two clues as to where he might be headed: Harry Potter''s defeat of You-Know-Who was Black''s downfall as well. And the Azkaban guards heard Black muttering in his sleep, "He''s at Hogwarts . . . he''s at Hogwarts."Harry Potter isn''t safe, not even within the walls of his magical school, surrounded by his friends. Because on top of it all, there may well be a traitor in their midst.', '276', TO_DATE('1999-07-12 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780316015844', 'Twilight (The Twilight Saga, #1)', '6XANPd7', 'Paperback', '498', '2005', 'English', 'Twilight (stylized as twilight) is a 2005 young adult vampire-romance novel by author Stephenie Meyer. It is the first book in the Twilight series, and introduces seventeen-year-old Isabella "Bella" Swan, who moves from Phoenix, Arizona to Forks, Washington. She is endangered after falling in love with Edward Cullen, a 103-year-old vampire frozen in his 17-year-old body. Additional novels in the series are New Moon, Eclipse, and Breaking Dawn.', 'Isabella Swan''s move to Forks, a small, perpetually rainy town in Washington, could have been the most boring move she ever made. But once she meets the mysterious and alluring Edward Cullen, Isabella''s life takes a thrilling and terrifying turn.
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780440242949', 'Outlander (Outlander, #1)', '5nr547K', 'Mass Market Paperback', '850', '1991', 'English', 'Outlander is a historical fantasy novel by Diana Gabaldon first published in 1991. Initially set around the time of the Second World War, it focuses on nurse Claire Beauchamp, who travels through time to 18th-century Scotland, where she finds adventure and romance with the dashing Jamie Fraser.', 'The year is 1945. Claire Randall, a former combat nurse, is just back from the war and reunited with her husband on a second honeymoon when she walks through a standing stone in one of the ancient circles that dot the British Isles. Suddenly she is a Sassenach—an “outlander”—in a Scotland torn by war and raiding border clans in the year of Our Lord...1743.
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781627792127', 'Six of Crows ', 'SuqJlJz', 'Hardcover', '465', '2015', 'English', 'Six of Crows is a fantasy novel written by American author Leigh Bardugo. The story follows a thieving crew and is primarily set in the city of Ketterdam, loosely inspired by Dutch Republic–era Amsterdam.', 'Ketterdam: a bustling hub of international trade where anything can be had for the right price—and no one knows that better than criminal prodigy Kaz Brekker. Kaz is offered a chance at a deadly heist that could make him rich beyond his wildest dreams. But he can’t pull it off alone. . . .
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781619634442', 'A Court of Thorns and Roses', 'NmW2wve', 'Hardcover', '419', '2015', 'English', 'A Court of Thorns and Roses is a new adult high fantasy novel series by American author Sarah J. Maas, beginning with the novel of the same name. The story follows the journey of mortal Feyre Archeron after she is brought into the faerie lands of Prythian for murdering a faerie, and the epic love story and fierce struggle that happens after she enters the fae lands.', 'Feyre''s survival rests upon her ability to hunt and kill – the forest where she lives is a cold, bleak place in the long winter months. So when she spots a deer in the forest being pursued by a wolf, she cannot resist fighting it for the flesh. But to do so, she must kill the predator and killing something so precious comes at a price ...
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781416914297', 'City of Ashes (The Mortal Instruments, #2)', '94yVB13', 'Hardcover', '453', '2008', 'English', 'City of Ashes is the second installment in The Mortal Instruments series, an urban fantasy series set in New York written by Cassandra Clare.', 'Clary Fray just wishes that her life would go back to normal. But what''s normal when you''re a demon-slaying Shadowhunter, your mother is in a magically induced coma, and you can suddenly see Downworlders like werewolves, vampires, and faeries? If Clary left the world of the Shadowhunters behind, it would mean more time with her best friend, Simon, who''s becoming more than a friend. But the Shadowhunting world isn''t ready to let her go — especially her handsome, infuriating, newfound brother, Jace. And Clary''s only chance to help her mother is to track down rogue Shadowhunter Valentine, who is probably insane, certainly evil — and also her father.
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780307346605', 'World War Z: An Oral History of the Zombie War', 'cm8DcrK', 'Hardcover', '342', '2006', 'English', 'World War Z is a follow-up to Brooks'' fictitious survival manual The Zombie Survival Guide (2003), but its tone is much more serious. It was inspired by The Good War: An Oral History of World War Two (1984) by Studs Terkel, and by the zombie films of George A. Romero (1968?2009). Brooks used World War Z to comment on government ineptitude and US isolationism, while also examining survivalism and uncertainty. The novel was a commercial hit and was praised by most critics. Its 2007 audiobook version, performed by a full cast including Alan Alda, Mark Hamill, and John Turturro, won an Audie Award. A film adaptation, directed by Marc Forster and starring Brad Pitt, was released in 2013, and a video game of the same name, based on the 2013 film, was released in 2019 by Saber Interactive.', 'The Zombie War came unthinkably close to eradicating humanity. Max Brooks, driven by the urgency of preserving the acid-etched first-hand experiences of the survivors from those apocalyptic years, traveled across the United States of America and throughout the world, from decimated cities that once teemed with upwards of thirty million souls to the most remote and inhospitable areas of the planet. He recorded the testimony of men, women, and sometimes children who came face-to-face with the living, or at least the undead, hell of that dreadful time. World War Z is the result. Never before have we had access to a document that so powerfully conveys the depth of fear and horror, and also the ineradicable spirit of resistance, that gripped human society through the plague years.', '275', TO_DATE('2006-09-18 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781884365300', 'The Jungle', 'J6mTq4Z', 'Paperback', '335', '1905', 'English', 'The Jungle is a 1906 novel by the American journalist and novelist Upton Sinclair. The novel portrays the harsh conditions and exploited lives of immigrants in the United States in Chicago and similar industrialized cities. Sinclair''s primary purpose in describing the meat industry and its working conditions was to advance socialism in the United States. The book depicts working-class poverty, lack of social supports, harsh and unpleasant living and working conditions, and hopelessness among many workers. These elements are contrasted with the deeply rooted corruption of people in power. A review by the writer Jack London called it "the Uncle Tom''s Cabin of wage slavery."', 'For nearly a century, the original version of Upton Sinclair''s classic novel has remained almost entirely unknown. When it was published in serial form in 1905, it was a full third longer than the censored, commercial edition published in book form the following year. That expurgated commercial edition edited out much of the ethnic flavor of the original, as well as some of the goriest descriptions of the meat-packing industry and much of Sinclair''s m', '140', TO_DATE('1905-06-11 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780385335997', 'Voyager (Outlander, #3)', 'GbkdKsw', 'Paperback', '870', '1993', 'English', 'Voyager (published 1993) is the third book in the Outlander series of novels by Diana Gabaldon. Centered on time travelling 20th century doctor Claire Randall and her 18th century Scottish Highlander warrior husband Jamie Fraser, the books contain elements of historical fiction, romance, adventure and fantasy.', 'From the author of the breathtaking bestsellers Outlander and Dragonfly in Amber, the extraordinary saga continues. Their passionate encounter happened long ago by whatever measurement Claire Randall took. Two decades before, she had traveled back in time and into the arms of a gallant eighteenth-century Scot named Jamie Fraser. Then she returned to her own century to bear his child, believing him dead in the tragic battle of Culloden. Yet his memory has never lessened its hold on her... and her body still cries out for him in her dreams. Then Claire discovers that Jamie survived. Torn between returning to him and staying with their daughter in her own era, Claire must choose her destiny. And as time and space come full circle, she must find the courage to face the passion and pain awaiting her...the deadly intrigues raging in a divided Scotland... and the daring voyage into the dark unknown that can reunite or forever doom her timeless love.', '141', TO_DATE('1993-09-16 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780385755887', 'All the Bright Places', 'SuM498p', 'Hardcover', '378', '2015', 'English', 'All the Bright Places is a young adult fiction novel by Jennifer Niven which is based on the author''s personal story. The novel was first published on January 6, 2015 and is Niven''s first young adult book. A film adaptation starring Elle Fanning and Justice Smith was released on February 28, 2020 on Netflix.', 'Theodore Finch is fascinated by death, and he constantly thinks of ways he might kill himself. But each time, something good, no matter how small, stops him. Violet Markey lives for the future, counting the days until graduation, when she can escape her Indiana town and her aching grief in the wake of her sister?s recent death. When Finch and Violet meet on the ledge of the bell tower at school, it?s unclear who saves whom. And when they pair up on a project to discover the ?natural wonders? of their state, both Finch and Violet make more important discoveries: It?s only with Violet that Finch can be himself?a weird, funny, live-out-loud guy who?s not such a freak after all. And it?s only with Finch that Violet can forget to count away the days and start living them. But as Violet?s world grows, Finch?s begins to shrink.', '142', TO_DATE('2015-01-07 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780061139376', 'Coraline', '0rfIIVR', 'Paperback', '162', '2002', 'English', 'Coralines a dark fantasy children''s novella by British author Neil Gaiman, published in 2002. It was awarded the 2003 Hugo Award for Best Novella, the 2003 Nebula Award for Best Novella, and the 2002 Bram Stoker Award for Best Work for Young Readers. The Guardian ranked Coraline #82 in its list of 100 Best Books of the 21st Century. Gaiman started writing Coraline in 1990. The titular character''s name came from a typo in "Caroline". According to Gaiman, "I had typed the name Caroline, and it came out wrong. I looked at the word Coraline, and knew it was someone''s name. I wanted to know what happened to her." It was adapted as a 2009 stop-motion animated film, directed by Henry Selick.', 'In Coraline''s family''s new flat are twenty-one windows and fourteen doors. Thirteen of the doors open and close. The fourteenth is locked, and on the other side is only a brick wall, until the day Coraline unlocks the door to find a passage to another flat in another house just like her own. Only it''s different. At first, things seem marvelous in the other flat. The food is better. The toy box is filled with wind-up angels that flutter around the bedroom, books whose pictures writhe and crawl and shimmer, little dinosaur skulls that chatter their teeth. But there''s another mother, and another father, and they want Coraline to stay with them and be their little girl. They want to change her and never let her go. Other children are trapped there as well, lost souls behind the mirrors. Coraline is their only hope of rescue. She will have to fight with all her wits and all the tools she can find if she is to save the lost children, her ordinary life, and herself. Critically acclaimed and award-winning author Neil Gaiman will delight readers with his first novel for all ages.', '147', TO_DATE('2002-02-13 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780062310637', 'Red Queen (Red Queen, #1)', 'Ci57C83', 'Hardcover', '383', '2015', 'English', 'Red Queen is a young adult fantasy novel written by American writer Victoria Aveyard. Published in February 2015, it was her first novel and first series. Aveyard followed up with three sequels: Glass Sword, King''s Cage and War Storm. Red Queen won the 2015 Goodreads Choice Award for Debut Goodreads Author and was nominated for the 2015 Goodreads Choice Award for Young Adult Fantasy & Science Fiction.', 'This is a world divided by blood?red or silver. The Reds are commoners, ruled by a Silver elite in possession of god-like superpowers. And to Mare Barrow, a seventeen-year-old Red girl from the poverty-stricken Stilts, it seems like nothing will ever change. That is until she finds herself working in the Silver Palace. Here, surrounded by the people she hates the most, Mare discovers that, despite her red blood, she possesses a deadly power of her own. One that threatens to destroy the balance of power. Fearful of Mare''s potential, the Silvers hide her in plain view, declaring her a long-lost Silver princess, now engaged to a Silver prince. Despite knowing that one misstep would mean her death, Mare works silently to help the Red Guard, a militant resistance group, and bring down the Silver regime. But this is a world of betrayal and lies, and Mare has entered a dangerous dance?Reds against Silvers, prince against prince, and Mare against her own heart.', '148', TO_DATE('2015-03-21 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780192839992', 'Dubliners', '1b46u0L', 'Paperback', '207', '1914', 'English', 'Dubliners is a collection of fifteen short stories by James Joyce, first published in 1914. It presents a naturalistic depiction of Irish middle class life in and around Dublin in the early years of the 20th century.', 'This work of art reflects life in Ireland at the turn of the last century, and by rejecting euphemism, reveals to the Irish their unromantic realities. Each of the 15 stories offers glimpses into the lives of ordinary Dubliners, and collectively they paint a portrait of a nation.', '149', TO_DATE('1914-07-02 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781593081430', 'The Age of Innocence', 'j30CYht', 'Paperback', '293', '1920', 'English', 'The Age of Innocence is a 1920 novel by American author Edith Wharton. It was her twelfth novel, and was initially serialized in 1920 in four parts, in the magazine Pictorial Review. Later that year, it was released as a book by D. Appleton & Company. It won the 1921 Pulitzer Prize for Fiction, making Wharton the first woman to win the prize. The story is set in the 1870s, in upper-class, "Gilded Age" New York City. Wharton wrote the book in her 50s, after she had established herself as a strong author, with publishers clamoring for her work.', 'This is Newland Archer?s world as he prepares to marry the beautiful but conventional May Welland. But when the mysterious Countess Ellen Olenska returns to New York after a disastrous marriage, Archer falls deeply in love with her. Torn between duty and passion, Archer struggles to make a decision that will either courageously define his life?or mercilessly destroy it.', '150', TO_DATE('1920-04-12 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781848764569', 'The Elephant Tree', '3W8kcy0', 'Paperback', '252', '2010', 'English', 'Reminiscent of Irvine Welsh''s Trainspotting, this debut novel, The Elephant Tree challenges the reader''s sense of morality with shocking plot twists and vivid characters.', 'Mark Fallon is an overworked detective investigating a spate of attacks at a string of high profile city centre nightclubs. Scott is a dejected 24 year old struggling to make ends meet working for his brother and supplementing his income with a small-scale drug dealing operation. Angela is an attractive 23 year old, raised by her father, a career criminal and small time drug dealer who supplies Scott with cannabis. This is a chilling tale spanning a few months in the lives of Scott and Angela, where realizations about the present combine with shocking revelations from the past leading to an apocalyptic climax where they no longer know whom they can trust', '151', TO_DATE('2010-05-06 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780609608449', 'The Devil in the White City: Murder, Magic, and Madness at the Fair That Changed America', '7osW2Q1', 'Hardcover', '447', '2002', 'English', 'The Devil in the White City: Murder, Magic, and Madness at the Fair That Changed America is a 2003 historical non-fiction book by Erik Larson presented in a novelistic style. It tells the story of the 1893 World''s Columbian Exposition in Chicago from the viewpoint of the designers, including Daniel Burnham, and also tells the story of H. H. Holmes, a criminal figure in that same time often credited as the first modern serial killer.', 'Author Erik Larson imbues the incredible events surrounding the 1893 Chicago World''s Fair with such drama that readers may find themselves checking the book''s categorization to be sure that ''The Devil in the White City'' is not, in fact, a highly imaginative novel. Larson tells the stories of two men: Daniel H. Burnham, the architect responsible for the fair''s construction, and H.H. Holmes, a serial killer masquerading as a charming doctor.', '152', TO_DATE('2002-05-05 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780375408267', 'The Reader', 'wQERpkK', 'Hardcover', '216', '1995', 'English', 'The Reader (German: Der Vorleser) is a novel by German law professor and judge Bernhard Schlink, published in Germany in 1995 and in the United States in 1997. The story is a parable, dealing with the difficulties post-war German generations have had comprehending the Holocaust; Ruth Franklin writes that it was aimed specifically at the generation Bertolt Brecht called the Nachgeborenen, those who came after. The Reader explores how the post-war generations should approach the generation that took part in, or witnessed, the atrocities. These are the questions at the heart of Holocaust literature in the late 20th and early 21st century, as the victims and witnesses die and living memory fades.', 'When he falls ill on his way home from school, fifteen-year-old Michael Berg is rescued by Hanna, a woman twice his age. In time she becomes his lover?then she inexplicably disappears. When Michael next sees her, he is a young law student, and she is on trial for a hideous crime. As he watches her refuse to defend her innocence, Michael gradually realizes that Hanna may be guarding a secret she considers more shameful than murder.', '154', TO_DATE('1995-08-03 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780747599876', 'The Tales of Beedle the Bard (Hogwarts Library)', '5FNxXQ2', 'Hardcover', '109', '2008', 'English', 'The Tales of Beedle the Bard is a book of children''s stories by the author J. K. Rowling. There is a storybook of the same name mentioned in Harry Potter and the Deathly Hallows, the last book of the Harry Potter series. The book was originally produced in a limited edition of only seven copies, each handwritten and illustrated by J. K. Rowling. ', 'The Tales of Beedle the Bard contains five richly diverse fairy tales, each with its own magical character, that will variously bring delight, laughter and the thrill of mortal peril. Additional notes for each story penned by Professor Albus Dumbledore will be enjoyed by Muggles and wizards alike, as the Professor muses on the morals illuminated by the tales, and reveals snippets of information about life at Hogwarts. A uniquely magical volume, with illustrations by the author, J. K. Rowling, that will be treasured for years to come.', '155', TO_DATE('2008-08-06 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781920769208', 'Shantaram', 'JELVLES', 'Paperback', '936', '2003', 'English', 'Shantaram is a 2003 novel by Gregory David Roberts, in which a convicted Australian bank robber and heroin addict escapes from Pentridge Prison and flees to India. The novel is commended by many for its vivid portrayal of tumultuous life in Bombay in the early to late 80s. The novel is reportedly influenced by real events in the life of the author, though some claims made by Roberts are contested by others involved in the story.', 'As a hunted man without a home, family, or identity, Lin searches for love and meaning while running a clinic in one of the city''s poorest slums, and serving his apprenticeship in the dark arts of the Bombay mafia. The search leads him to war, prison torture, murder, and a series of enigmatic and bloody betrayals. The keys to unlock the mysteries and intrigues that bind Lin are held by two people. The first is Khader Khan: mafia godfather, criminal-philosopher-saint, and mentor to Lin in the underworld of the Golden City. The second is Karla: elusive, dangerous, and beautiful, whose passions are driven by secrets that torment her and yet give her a terrible power', '156', TO_DATE('2003-04-02 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780743225427', 'The Shipping News', 'vpac8Li', 'Paperback', '337', '1993', 'English', 'The Shipping News is a novel by American author E. Annie Proulx and published by Charles Scribner''s Sons in 1993. It won the Pulitzer Prize for Fiction, the U.S. National Book Award, as well as other awards. It was adapted as a film of the same name which was released in 2001.', 'When Quoyle''s two-timing wife meets her just deserts, he retreats with his two daughters to his ancestral home on the starkly beautiful Newfoundland coast, where a rich cast of local characters and family members all play a part in Quoyle''s struggle to reclaim his life. As Quoyle confronts his private demons--and the unpredictable forces of nature and society--he begins to see the possibility of love without pain or misery. A vigorous, darkly comic, and at times magical portrait of the contemporary North American family, The Shipping News shows why Annie Proulx is recognized as one of the most gifted and original writers in America today.', '158', TO_DATE('1993-08-04 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780142402498', 'Pippi Longstocking', 'LTb9wxg', 'Mass Market Paperback', '160', '1945', 'English', 'Pippi Longstocking is the fictional main character in an eponymous series of children''s books by Swedish author Astrid Lindgren. Pippi was named by Lindgren''s daughter Karin, who asked her mother for a get-well story when she was off school. The three Pippi chapter books (Pippi Longstocking, Pippi Goes on Board, and Pippi in the South Seas) were published from 1945 to 1948, followed by three short stories and a number of picture book adaptations. They have been translated into 76 languages as of 2018 and made into several films and television series.', 'Tommy and his sister Annika have a new neighbor, and her name is Pippi Longstocking. She has crazy red pigtails, no parents to tell her what to do, a horse that lives on her porch, and a flair for the outrageous that seems to lead to one adventure after another!', '159', TO_DATE('1945-03-19 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780449213445', 'The Chosen (Reuven Malther #1)', 'xsUWobb', 'Mass Market Paperback', '304', '1966', 'English', 'The Chosen is a novel written by Chaim Potok. It was first published in 1967. It follows the narrator Reuven Malter and his friend Daniel Saunders, as they grow up in the Williamsburg neighborhood in Brooklyn, New York, in the 1940s. A sequel featuring Reuven''s young adult years, The Promise, was published in 1969.', 'It is the now-classic story of two fathers and two sons and the pressures on all of them to pursue the religion they share in the way that is best suited to each. And as the boys grow into young men, they discover in the other a lost spiritual brother, and a link to an unexplored world that neither had ever considered before. In effect, they exchange places, and find the peace that neither will ever retreat from again.', '160', TO_DATE('1966-05-01 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780446617796', 'The Angel Experiment (Maximum Ride, #1)', 'ne28AUp', 'Mass Market Paperback', '445', '2005', 'English', 'Maximum Ride: The Angel Experiment is the first book in the Maximum Ride series by James Patterson. The book was released in the US on April 11, 2005 and in the UK on July 4, 2005. The book is set in the near future and centers on the flock, a group of human-avian hybrids (98% human, 2% bird) on the run from the scientists who created them. It focuses on Maximum Ride (Max), the leader of the flock, and the first-person narrator and protagonist of the story.', 'Six unforgettable kids ? with no families, no homes ? are running for their lives. Max Ride and her best friends have the ability to fly. And that''s just the beginning of their amazing powers. But they don''t know where they come from, who''s hunting them, why they are different from all other humans... and if they''re meant to save mankind ? or destroy it.', '161', TO_DATE('2005-05-21 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781576469231', 'The Scarlet Pimpernel', 'XQXl2PX', 'Paperback', '182', '1905', 'English', 'The Scarlet Pimpernel is the first novel in a series of historical fiction by Baroness Orczy, published in 1905. It was written after her stage play of the same title enjoyed a long run in London, having opened in Nottingham in 1903. The novel is set during the Reign of Terror following the start of the French Revolution. The title is the nom de guerre of its hero and protagonist, a chivalrous Englishman who rescues aristocrats before they are sent to the guillotine.  Orczy''s premise of a daring hero who cultivates a secret identity disguised by a meek or ineffectual manner proved enduring. Zorro, Doctor Syn, the Shadow, the Spider, the Phantom, Superman and Batman followed within a few decades, and the trope remains a popular one in serial fiction today.', 'The year is 1792. The French Revolution, driven to excess by its own triumph, has turned into a reign of terror. Daily, tumbrels bearing new victims to the guillotine roll over the cobbled streets of Paris.... Thus the stage is set for one of the most enthralling novels of historical adventure ever written. The mysterious figure known as the Scarlet Pimpernel, sworn to rescue helpless men, women, and children from their doom; his implacable foe, the French agent Chauvelin, relentlessly hunting him down; and lovely Marguerite Blakeney, a beautiful French exile married to an English lord and caught in a terrible conflict of loyalties--all play their parts in a suspenseful tale that ranges from the squalid slums of Paris to the aristocratic salons of London, from intrigue on a great English country estate to the final denouement on the cliffs of the French coast.', '271', TO_DATE('1905-08-04 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780975925515', 'Houdini Heart', 'cxfF9cw', 'Paperback', '254', '2011', 'English', 'Houdini Heart, published in 2011, is a tale of bone-chilling horror, emotional torment, and psychological terror. Gripped by River House, trapped in an aging hotel of mirrors only Houdini could escape, how much can haunt a mind before it too is only a thing once imagined?', 'HOUDINI HEART harkens back to the masters of suspenseful supernatural horror: Poe, Lovecraft, Shirley Jackson, but speaks with a wholly fresh voice. Once caught in its pages, there''s no escaping Longfellow''s terrible tale. Weeks ago, she was one of Hollywood''s biggest writers, wed to one of its greatest stars. The doting mother of their golden child. But now? She''s alone, tortured by a horrifying secret no woman could bear. Pursued by those she can''t outrun, anguished by a guilt she can''t endure, and driven close to madness, she flees to the one place she''s ever called home: a small town in Vermont where River House still stands. To a child, the splendid hotel was mysterious and magical and all its glamorous guests knew delicious secrets. Cocooned in its walls, she will write one last book. Her atonement? Or her suicide note? But life is never as you dream it, and River House isn''t what she''d always imagined it was.', '272', TO_DATE('2011-02-06 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781619630659', 'Heir of Fire (Throne of Glass, #3)', 'H1rUhut', 'Hardcover', '565', '2014', 'English', 'Throne of Glass is a young adult high fantasy novel series by American author Sarah J. Maas, beginning with Throne of Glass, released in August 2012. The story follows the journey of Celaena Sardothien, a teenage assassin in a corrupt kingdom with a tyrannical ruler, the King of Adarlan. As the tale progresses, Celaena forms unexpected bonds and uncovers a conspiracy amidst her adventures. The series concluded with the eighth book in October 2018.', 'Celaena has survived deadly contests and shattering heartbreak-but at an unspeakable cost. Now, she must travel to a new land to confront her darkest truth . . . a truth about her heritage that could change her life-and her future-forever. Meanwhile, brutal and monstrous forces are gathering on the horizon, intent on enslaving her world. Will Celaena find the strength to not only fight her inner demons, but to take on the evil that is about to be unleashed?', '273', TO_DATE('2014-02-04 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780670016907', 'The Grapes of Wrath', 'RbMX5HK', 'Hardcover', '479', '1939', 'English', 'The Grapes of Wrath is an American realist novel written by John Steinbeck and published in 1939. The book won the National Book Award and Pulitzer Prizefor fiction, and it was cited prominently when Steinbeck was awarded the Nobel Prize in 1962. The Grapes of Wrath is frequently read in American high school and college literature classes due to its historical context and enduring legacy. A celebrated Hollywood film version, starring Henry Fonda and directed by John Ford, was released in 1940.', 'First published in 1939, Steinbeck?s Pulitzer Prize-winning epic of the Great Depression chronicles the Dust Bowl migration of the 1930s and tells the story of one Oklahoma farm family, the Joads?driven from their homestead and forced to travel west to the promised land of California. Out of their trials and their repeated collisions against the hard realities of an America divided into Haves and Have-Nots evolves a drama that is intensely human yet majestic in its scale and moral vision, elemental yet plainspoken, tragic but ultimately stirring in its human dignity. A portrait of the conflict between the powerful and the powerless, of one man?s fierce reaction to injustice, and of one woman?s stoical strength, the novel captures the horrors of the Great Depression and probes into the very nature of equality and justice in America. At once a naturalistic epic, captivity narrative, road novel, and transcendental gospel, Steinbeck?s powerful landmark novel is perhaps the most American of American Classics.', '275', TO_DATE('1939-06-23 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780812970067', 'Inferno', 'ZMXwXKL', 'Paperback', '490', '2013', 'English', 'Inferno is a 2013 mystery thriller novel by American author Dan Brown and the fourth book in his Robert Langdon series, following Angels & Demons, The Da Vinci Code and The Lost Symbol. The book was published on May 14, 2013, ten years after publication of The Da Vinci Code, by Doubleday.', 'Harvard professor of symbology Robert Langdon awakens in an Italian hospital, disoriented and with no recollection of the past thirty-six hours, including the origin of the macabre object hidden in his belongings. With a relentless female assassin trailing them through Florence, he and his resourceful doctor, Sienna Brooks, are forced to flee. Embarking on a harrowing journey, they must unravel a series of codes, which are the work of a brilliant scientist whose obsession with the end of the world is matched only by his passion for one of the most influential masterpieces ever written, Dante Alighieri''s The Inferno.', '155', TO_DATE('2013-02-07 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('0984800514', 'অপেক্ষা', 'Sd36jdM', 'Hardcover', '213', '1997', 'Bangla', 'অপেক্ষা হুমায়ূন আহমেদ রচিত একটি উপন্যাস। হুমায়ূন আহমেদের অন্যান্য উপন্যাসের মতোই এ উপন্যাসটির প্রেক্ষাপটও একটি মধ্যবিত্ত পরিবারকে ঘিরে। মধ্যবিত্তের টানাপোড়ন যেমন রয়েছে উপন্যাসটিতে ঠিক তেমনই প্রিয় মানুষের প্রতি একজন মানুষের অকৃত্রিম যে ভালোবাসা তারও বহিঃপ্রকাশ ঘটেছে চরিত্রগুলোর মাঝে।', 'মানুষের জীবন কি চক্রের মত? চক্রের কোন শুরু নেই, শেষ নেই। মানব জীবনও কি তাই? রহস্যময় চক্রের ভেতর এই জীবন ঘুরপাক খেতে থাকে? শুরু নেই, শেষ নেই। চক্র ঘুরছে।
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780007442911', 'Insurgent (Divergent, #2)', 'z6B6Nu0', 'Hardcover', '525', '2012', 'English', 'Insurgent is a 2012 science fiction young adult novel by American novelist Veronica Roth and the second book in the Divergent trilogy. As the sequel to the 2011 bestseller Divergent, it continues the story of Tris Prior and the dystopian post-apocalyptic version of Chicago.', 'One choice can transform you—or it can destroy you. But every choice has consequences, and as unrest surges in the factions all around her, Tris Prior must continue trying to save those she loves—and herself—while grappling with haunting questions of grief and forgiveness, identity and loyalty, politics and love.
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9781416524793', 'Angels & Demons (Robert Langdon, #1)', 'uuFNE0z', 'Mass Market Paperback', '736', '2000', 'English', 'Angels & Demons is a 2000 bestselling mystery-thriller novel written by American author Dan Brown and published by Pocket Books and then by Corgi Books. The novel introduces the character Robert Langdon, who recurs as the protagonist of Brown''s subsequent novels.', 'World-renowned Harvard symbologist Robert Langdon is summoned to a Swiss research facility to analyze a cryptic symbol seared into the chest of a murdered physicist. What he discovers is unimaginable: a deadly vendetta against the Catholic Church by a centuries-old underground organization -- the Illuminati. In a desperate race to save the Vatican from a powerful time bomb, Langdon joins forces in Rome with the beautiful and mysterious scientist Vittoria Vetra. Together they embark on a frantic hunt through sealed crypts, dangerous catacombs, and deserted cathedrals, and into the depths of the most secretive vault on earth...the long-forgotten Illuminati lair.', '271', TO_DATE('2000-01-01 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('0143037617', 'Bleak House', 'FK3QpVl', 'Paperback', '1017', '1853', 'English', 'Bleak House is a novel by Charles Dickens, first published as a 20-episode serial between March 1852 and September 1853. The novel has many characters and several sub-plots, and is told partly by the novel''s heroine, Esther Summerson, and partly by an omniscient narrator. At the centre of Bleak House is a long-running legal case in the Court of Chancery, Jarndyce and Jarndyce, which comes about because a testator has written several conflicting wills.', 'Bleak House opens in the twilight of foggy London, where fog grips the city most densely in the Court of Chancery. The obscure case of Jarndyce and Jarndyce, in which an inheritance is gradually devoured by legal costs, the romance of Esther Summerson and the secrets of her origin, the sleuthing of Detective Inspector Bucket and the fate of Jo the crossing-sweeper, these are some of the lives Dickens invokes to portray London society, rich and poor, as no other novelist has done. Bleak House, in its atmosphere, symbolism and magnificent bleak comedy, is often regarded as the best of Dickens. A ''great Victorian novel'', it is so inventive in its competing plots and styles that it eludes interpretation.', '271', TO_DATE('1853-02-02 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('0393341763', 'A Clockwork Orange', 'WpCrCTL', 'Paperback', '213', '1962', 'English', 'A Clockwork Orange is a dystopian satirical black comedy novel by English writer Anthony Burgess, published in 1962. It is set in a near-future society that has a youth subculture of extreme violence', 'In Anthony Burgess''s influential nightmare vision of the future, criminals take over after dark. Teen gang leader Alex narrates in fantastically inventive slang that echoes the violent intensity of youth rebelling against society. Dazzling and transgressive, A Clockwork Orange is a frightening fable about good and evil and the meaning of human freedom.', '288', TO_DATE('1962-11-01 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('0060929871', 'Brave New World', 'o1O0WCL', 'Paperback', '268', '1932', 'English', 'Brave New World is a dystopian social science fiction novel by English author Aldous Huxley, written in 1931 and published in 1932.', 'Brave New World is a dystopian novel by English author Aldous Huxley, written in 1931 and published in 1932. Largely set in a futuristic World State, inhabited by genetically modified citizens and an intelligence-based social hierarchy, the novel anticipates huge scientific advancements in reproductive technology, sleep-learning, psychological manipulation and classical conditioning that are combined to make a dystopian society which is challenged by only a single individual: the story''s protagonist.', '287', TO_DATE('1932-01-25 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('0735219117', 'Where the Crawdads Sing', '9brJgXh', 'Ebook', '384', '2018', 'English', 'Where the Crawdads Sing is a 2018 novel by American author Delia Owens. It has topped The New York Times Fiction Best Sellers of 2019 and The New York Times Fiction Best Sellers of 2020 for a combined 32 non-consecutive weeks. As of late January 2021, the book has spent 124 weeks on the best seller list.', 'For years, rumors of the ''Marsh Girl'' haunted Barkley Cove, a quiet fishing village. Kya Clark is barefoot and wild; unfit for polite society. So in late 1969, when the popular Chase Andrews is found dead, locals immediately suspect her.
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780450040184', 'The Shining', '4Ama4gb', 'Paperback', '659', '1977', 'English', 'The Shining is a 1977 horror novel by American author Stephen King. It is King''s third published novel and first hardback bestseller; its success firmly established King as a preeminent author in the horror genre.', 'Jack Torrance''s new job at the Overlook Hotel is the perfect chance for a fresh start. As the off-season caretaker at the atmospheric old hotel, he''ll have plenty of time to spend reconnecting with his family and working on his writing. But as the harsh winter weather sets in, the idyllic location feels ever more remote...and more sinister. And the only one to notice the strange and terrible forces gathering around the Overlook is Danny Torrance, a uniquely gifted five-year-old.', '152', TO_DATE('1980-03-07 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('5471236501', 'The Woman in the Window', 'W1YitQK', 'Paperback', '455', '2018', 'English', 'The Woman in the Window is a thriller novel by American author AJ Finn.', 'Anna Fox lives alone, a recluse in her New York City home, unable to venture outside. She spends her day drinking wine (maybe too much), watching old movies, recalling happier times . . . and spying on her neighbors.
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780312577223', 'The Nightingale', 'uDrpwKF', 'Hardcover', '448', '2015', 'English', 'The Nightingale is a historical fiction novel by American author Kristin Hannah published by St. Martin''s Press in 2015. The book tells the story of two sisters in France during World War II and their struggle to survive and resist the German occupation of France.', 'In the quiet village of Carriveau, Vianne Mauriac says goodbye to her husband, Antoine, as he heads for the Front. She doesn’t believe that the Nazis will invade France…but invade they do, in droves of marching soldiers, in caravans of trucks and tanks, in planes that fill the skies and drop bombs upon the innocent. When a German captain requisitions Vianne’s home, she and her daughter must live with the enemy or lose everything. Without food or money or hope, as danger escalates all around them, she is forced to make one impossible choice after another to keep her family alive.
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780425132159', 'Good Omens: The Nice and Accurate Prophecies of Agnes Nutter, Witch', 'LN7LNYz', 'Paperback', '491', '2006', 'English', 'Good Omens: The Nice and Accurate Prophecies of Agnes Nutter, Witch is a 1990 novel written as a collaboration between the English authors Terry Pratchett and Neil Gaiman. The book is a comedy about the birth of the son of Satan and the coming of the End Times.', '‘Armageddon only happens once, you know. They don’t let you go around again until you get it right.’
INSERT INTO "BOOK" ("ISBN", "TITLE", "COVER_IMAGE", "BINDING", "NUMBER_OF_PAGES", "ORIGINAL_PUBLICATION_YEAR", "LANGUAGE", "DESCRIPTION", "SUMMARY", "PUBLISHER_ID", "PUBLICATION_DATE") VALUES ('9780198709701', 'Crime and Punishment', 'tiXZct9', 'Hardcover', '429', '1866', 'Russian', 'Crime and Punishment is a novel by the Russian author Fyodor Dostoevsky. It was first published in the literary journal The Russian Messenger in twelve monthly installments during 1866. It was later published in a single volume.', 'Raskolnikov, a destitute and desperate former student, wanders through the slums of St Petersburg and commits a random murder without remorse or regret. He imagines himself to be a great man, a Napoleon: acting for a higher purpose beyond conventional moral law. But as he embarks on a dangerous game of cat and mouse with a suspicious police investigator, Raskolnikov is pursued by the growing voice of his conscience and finds the noose of his own guilt tightening around his neck. Only Sonya, a downtrodden sex worker, can offer the chance of redemption.', '136', TO_DATE('1866-03-15 00:00:00', 'SYYYY-MM-DD HH24:MI:SS'));
