INSERT INTO "REVIEW" ("REVIEW_ID", "ISBN", "PERSON_ID", "REVIEW_CONTENT", "REVIEW_DATE") VALUES ('120', '1250301696', '109', 'This book is the very definition of a page-turner. From the very first page I was seduced by the magnetic writing style of Alex Michaelides.', TO_DATE('2022-02-12 04:31:33', 'SYYYY-MM-DD HH24:MI:SS'));
