INSERT INTO "REVIEW" ("REVIEW_ID", "ISBN", "PERSON_ID", "REVIEW_CONTENT", "REVIEW_DATE") VALUES ('106', '0735219117', '107', 'This book is beautifully written and contains poetry and vivid descriptions of the Marsh. I highly recommend this book! It''s thoughtful, evokes emotion, and transports the reader back in time to the Marsh. I loved every page.', TO_DATE('2022-02-12 04:25:56', 'SYYYY-MM-DD HH24:MI:SS'));
