INSERT INTO "REVIEW" ("REVIEW_ID", "ISBN", "PERSON_ID", "REVIEW_CONTENT", "REVIEW_DATE") VALUES ('102', '9780439655484', '107', 'I am both pleasantly surprised and mad that I ended up enjoying this audiobook and getting invested in Sirius Black. The story really improved when we discovered more about the background story of events that happened before Harry''s generation. I enjoyed learning more about the adult characters and being surprised at the plot developments.', TO_DATE('2022-02-12 04:25:17', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "REVIEW" ("REVIEW_ID", "ISBN", "PERSON_ID", "REVIEW_CONTENT", "REVIEW_DATE") VALUES ('101', '9781416524793', '109', 'I didn''t even delve into how awful of a writer he is, did I? The only thing more embarrassing than his writing that will never be remembered 20 years from now, is the fact that so many people bought into this and wasted their time with it. Including respectable people like Tom Hanks and Ron Howard. There''s time you will never get back again. Congrats!', TO_DATE('2022-02-12 04:28:45', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "REVIEW" ("REVIEW_ID", "ISBN", "PERSON_ID", "REVIEW_CONTENT", "REVIEW_DATE") VALUES ('110', '0735219117', '109', 'This book is just a pile of tropes and cliches dressed up in some nice nature writing. The plot is not much of a plot and the mystery makes up only a small section of the book, and much of it ends up being courtroom scenes and not much mystery. This book is basically Manic Pixie Dream Girl In the Marsh. We spend a long time with young Kya, abandoned, fending for herself, almost entirely isolated. I was willing to be patient through all that, to see what kind of person she would grow into because that had the potential to be very interesting.', TO_DATE('2022-02-12 04:29:27', 'SYYYY-MM-DD HH24:MI:SS'));
