INSERT INTO "REVIEW" ("REVIEW_ID", "ISBN", "PERSON_ID", "REVIEW_CONTENT", "REVIEW_DATE") VALUES ('108', '9780440242949', '107', 'I always found Gabaldon''s characters delightfully complex and well-developed. Maybe not everyone feels the same about Claire and Jamie, but I think one of the signs of a great writer is when they can really test my love for their characters, make them do the worst kind of things and still have me angsting over whether or not they would be okay in the end. And I cared for Claire and Jamie. They''re one of the few literary couples that I have completely fallen in love with and cared about.', TO_DATE('2022-02-12 04:24:41', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "REVIEW" ("REVIEW_ID", "ISBN", "PERSON_ID", "REVIEW_CONTENT", "REVIEW_DATE") VALUES ('112', '9781416524793', '107', 'The apotheosis of laugh out loud, so-bad-it''s-good writing, it''s at first enthralling but descends into garish absurdity.', TO_DATE('2022-02-12 04:26:31', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "REVIEW" ("REVIEW_ID", "ISBN", "PERSON_ID", "REVIEW_CONTENT", "REVIEW_DATE") VALUES ('113', '9780440242949', '109', 'I gave up on this book because I was sustaining permanent damage from reading it and I was afraid I''d start hitting back. And it''s a borrowed copy, so that wouldn''t be cool.', TO_DATE('2022-02-12 05:26:59', 'SYYYY-MM-DD HH24:MI:SS'));
